import React from 'react';

const workoutItems = [
    {
      id: 1,
      title: 'Cardio Blast',
      description: 'High-intensity cardio workout to boost your endurance and burn calories.',
      imageUrl: 'cardio-image.jpg',
      altText: 'Cardio Workout',
    },
    {
      id: 2,
      title: 'Strength Training',
      description: 'Build strength and muscle mass with effective resistance training exercises.',
      imageUrl: 'strength-training-image.jpg',
      altText: 'Strength Training',
    },
    {
      id: 3,
      title: 'Yoga Flow',
      description: 'Relax your mind and body while improving flexibility and balance with yoga poses.',
      imageUrl: 'yoga-flow-image.jpg',
      altText: 'Yoga Flow',
    },
    {
      id: 4,
      title: 'HIIT Workout',
      description: 'High-intensity interval training for maximum calorie burn and fitness gains.',
      imageUrl: 'hiit-workout-image.jpg',
      altText: 'HIIT Workout',
    },
  ];

function Workouts() {
    return (
        <div className="hero">
            <div className="hero-content">
                <div className="text-content">
                    <h1>Ready. Set.</h1>
                    <h2>Workout plan for the week</h2>
                    <p>Be the best version of yourself.</p>
                </div>
                <div className="workout-items">
          {workoutItems.map((workout) => (
            <div key={workout.id} className="workout-item">
              <img src={workout.imageUrl} alt={workout.altText} />
              <div className="workout-info">
                <h3>{workout.title}</h3>
                <p>{workout.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Workouts;
